import React from "react";
import Template from "../mainTemplate.js";
import FadeBC from "../../components/FadeBC";
import {
  PaddingContainer,
  LatinText
} from "../../components/SpacingComponents";

const FadeIn2 = () => (
  <Template
    title="Fade In | Bounding Client"
    description="Fade in component with bounding client..."
  >
    <LatinText />
    <FadeBC fadeIn={true} />
    <PaddingContainer />
    <FadeBC fadeIn={false} />
    <PaddingContainer />
    <FadeBC fadeIn={true} />
    <PaddingContainer />
    <FadeBC fadeIn={false} />
    <PaddingContainer height="500px" />
  </Template>
);

export default FadeIn2;
